import React, { useState } from "react";
import "./login.css"


function Login() {
    const [login,setLogin]=useState(true);
function chgForm(e){
    setLogin(!login)
}

    return (
        <>
        {login?<LoginForm/>:<SignupForm/>}
        
        
       
        </>
        
        


        
    )

}
export default Login

function LoginForm(){

    return(
<div className="form">
           
           <h4>
               Login
           </h4>
          
           <label>Your Email</label>
           <br />
           <input type="email" />
           <label>Your Password</label>
           <br />
           <input type="password" />
           <br /><br />
           <button>Login</button>
            <br />
           <p onClick={chgForm}>Create new account</p>

       </div>

    );
}
function SignupForm(){

    return (
        <div className="form">
           
        <h4>
            Sign Up
        </h4>
       
        <label>Your Email</label>
        <br />
        <input type="email" />
        <label>Your Password</label>
        <br />
        <input type="password" />
        <br /><br />
        <button>Create account</button>
         <br />
        <p onClick={chgForm}>Login with existing account</p>

    </div>
    

    )
}
